import React from 'react';
import '../css/Service.css';

function Service(){
  return (
      <div className="service">
        <h1>Service</h1>
          <div className="con-service">
            <div className="itm-service left">App Developer
            </div>
            <div className="itm-service right">Web Developer
            </div>
          </div>
      </div>
  );
}

export default Service;
